	def test_has_error(self):
		self.assertFalse(has_error('Delhi',weather_response("Delhi","2ab136be1543b5789451a5994364c0d3")))
		self.assertFalse(has_error('delhi',weather_response("Delhi","2ab136be1543b5789451a5994364c0d3")))
